#include <bits/stdc++.h>
#define DEBUG false
#define debugf if (DEBUG) printf
#define MAXN 200309
#define MAXM 900009
#define ALFA 256
#define MOD 1000000007
#define INF 0x3f3f3f3f
#define INFLL 0x3f3f3f3f3f3f3f3f
#define EPS 1e-9
#define PI 3.141592653589793238462643383279502884
#define FOR(x,n) for(int x=0; (x)<int(n); (x)++)
#define FOR1(x,n) for(int x=1; (x)<=int(n); (x)++)
#define REP(x,n) for(int x=int(n)-1; (x)>=0; (x)--)
#define REP1(x,n) for(int x=(n); (x)>0; (x)--)
#define pb push_back
#define pf push_front
#define fi first
#define se second
#define mp make_pair
#define all(x) x.begin(), x.end()
#define mset(x,y) memset(&x, (y), sizeof(x));
using namespace std;
typedef long long ll;
typedef unsigned long long ull;
typedef long double ld;
typedef unsigned int uint;
typedef vector<int> vi;
typedef pair<int, int> ii;

struct point {
	ll x, y, z;
	point(ll x = 0, ll y = 0, ll z = 0) : x(x), y(y), z(z) {}
};

point operator -(point a, point b) {
	return point(a.x-b.x, a.y-b.y, a.z-b.z);
}

ll inner(point a, point b) {
	return a.x*b.x + a.y*b.y + a.z*b.z;
}

point cross(point p1, point p2) {
	point ans;
	ans.x = p1.y*p2.z - p1.z*p2.y;
	ans.y = p1.z*p2.x - p1.x*p2.z;
	ans.z = p1.x*p2.y - p1.y*p2.x;
	return ans;
}

bool checkface(point a, point b, point c, point d, point x) {
	point n = cross(b-a, c-a);
	ll i1 = inner(d-a, n);
	ll i2 = inner(x-a, n);
	return i1*i2 < 0;
}

point read() {
	ll x, y, z;
	scanf("%lld %lld %lld", &x, &y, &z);
	return point(x, y, z);
}

int main() {
	int T;
	scanf("%d", &T);
	FOR1(caseNo, T) {
		point a = read();
		point b = read();
		point c = read();
		point d = read();
		point x = read();
		printf("%c", checkface(b, c, d, a, x) ? 'Y' : 'N');
		printf("%c", checkface(c, d, a, b, x) ? 'Y' : 'N');
		printf("%c", checkface(d, a, b, c, x) ? 'Y' : 'N');
		printf("%c", checkface(a, b, c, d, x) ? 'Y' : 'N');
		printf("\n");
	}
}